import Input from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';

const styleInput = {
    height: '100px',
    width: 'auto',
    top: '40px',
    margin: '0px auto',
};
const styleBack = {
    background: '#ccc',
    height: '500px',
    width: '450px',
    alignItems: 'center',
    borderRadius: "16px",
    margin: '0px auto',
}

const Login = () =>{
    return(
        <div style = {styleBack}>
            <form>
                <Input style={styleInput} placeholder="YourEmail@mail.com" 
                       label="Email" variant="outlined"/>
                <Input style={styleInput} type="password" autoComplete="current-password"
                       placeholder="Input Password" label="Password" variant="outlined"/>
                <Button style={styleInput}>SIGN IN</Button>
            </form>
        </div>
    )
}

export default Login;
